import React, { Component, Fragment, useState } from 'react';
import {render} from 'react-dom'

function Configform({handlechange}) {
    return <form>
        <div className='form-composant'>
            <label htmlFor="email">E-mail</label>
            <input type="text" id='email' name="nom" onChange={handlechange}/>
        </div>
        <div className='form-composant'>
            <label htmlFor="mdp">Password</label>
            <input type="password" id='mdp' name="nom" onChange={handlechange}/>
        </div>
    </form>
    
}
export function Form() {
    const [mail, setMail] = useState('')
    const [mdp, setMdp] = useState('')
    const handlechange = (e)=>{
        setMail(e.target.value)
        setMdp(e.target.value)
        console.log(mail)
        console.log(mdp)
    }
    return <Fragment>
        <Configform handleChange ={handlechange}/>
    </Fragment>
}
